object_title:
Série de 6 tableaux réalisés pour l'accrochage du Musée national d'art moderne, Centre Pompidou : 
- L'espace vide 5e étage : Le Paradis  
- La place de Degottex : Le choix de Pâris;
- Salle Duchamp prête : Bonjour Monsieur Courbet ;
- Le montage de la salle blanche de Marcel Broodthaers : La Descente de croix;  
- Veilhan en caisse : Oedipe et le Sphinx; 
- Jason Rhoades en réglage : La nativité;
